        крой лифа помогает скорректировать грудь придавей более круглую аппетитную форму;
        трусики-стринги со вставкой из кружева,акцентирую внимание на ягодицах;
        пояс с регулируемыми пажами для чулок,застегивается сзади, а его необычный крой, подчеркивает красоту женских бедер;
         дополнительный акцент – блестящий,металлический (не содержит никель) кулон-сердечко.
